from typing import List

class Solution:
    def minimumCost(self, source: str, target: str, original: List[str], changed: List[str], cost: List[int]) -> int:
        change_cost = {}
        for o, c, co in zip(original, changed, cost):
            key = (o, c)
            if key not in change_cost:
                change_cost[key] = co
            else:
                change_cost[key] = min(change_cost[key], co)

        dp = [0] * (len(source) + 1)
        for i in range(len(source) - 1, -1, -1):
            if source[i] == target[i]:
                dp[i] = dp[i + 1]
            else:
                key = (source[i], target[i])
                if key in change_cost:
                    dp[i] = dp[i + 1] + change_cost[key]
                else:
                    return -1
        return dp[0]
